import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router,Route,Routes} from 'react-router-dom';
import Registeration from './Registeration';
import Login from './Login'
import Home from './Home'
import Rooms from './Rooms'
import Logout from './Logout'
import Account from './Account'
var token=JSON.parse(localStorage.getItem('token'));
var flag=JSON.parse(localStorage.getItem(Boolean))
console.log(token)
ReactDOM.render(
  <Router>
  <Routes>
  <Route path="/Login" element={token==="NULL"?<Login/>:<Home/>}></Route>
      <Route path="/Login/Registeration" element={token==="NULL"?<Registeration/>:<Home/>}></Route>
      <Route exact path="/" element={<Home/>}></Route>
      <Route path="/Rooms" element={flag===true?<Rooms/>:<Home/>}></Route>
      <Route path="/Logout" element={<Logout/>}></Route>
      <Route path="/Account" element={token!=="NULL"?<Account/>:<Home/>}></Route>
  </Routes>
  </Router>,
  document.getElementById('root')
);
